import DealItem from './DealItem/DealItem'


const DealList = (props) => {
  const deals = props.deals.map(deal => {
    return (<DealItem title={deal.title} text={deal.text} />)
  })
  return (
    <div>
      {deals}
    </div>
  )
}


export default DealList
